double clamp_t(double t) {
    return t == 20 ? 0.0 : t;
}

double clamp_v(double v) {
    // Apparently UPPAAL has min <? and max >? operators. 
    return 4.8 >? v <? 25.2;
}

double clamp_l(double l) {
    return -0.001 >? l <? 2;
}

