int shield(int action) {
    int color = get_value(clamp_t(t), clamp_v(v), p, clamp_l(l));
    debug1 = color;
    if (color == RED)
        return action;
    else if (color == BLUE)
        return OFF;
    else if (color == GREEN)
        return ON;
    else if (color == WHITE)
        return action;
    else
        return -1;
}

